    }
    return (
        <h1>
            <form onSubmit={handleSubmit}>
                <label>
                    USERNAME
                    <input type="text" name="username" onChange={handleChange} value={user.username} />
                </label>
                <label>
                    PASSWORD
                    <input type="password" name="password" onChange={handleChange} value={user.password} />
                </label>
                <button type="submit"></button>
            </form>

        </h1>

    )
}

